import React from "react";
import {
  Text,
  StyleSheet,
  View,
  ImageBackground,
  TouchableOpacity,
  Button,
} from "react-native";

const WelcomeScreen = ({ navigation }) => {
  return (
    <ImageBackground
      style={styles.background}
      source={{
        uri: "https://source.unsplash.com/featured/?abstract,background,white",
      }}
    >
      <View style={styles.overlay} />
      <View style={styles.container}>
        <TouchableOpacity style={styles.button}>
          <Text style={styles.btnText}>Go to Home</Text>{" "}
        </TouchableOpacity>
        <TouchableOpacity style={styles.button}>
          <Text style={styles.btnText}> See List</Text>{" "}
        </TouchableOpacity>
      </View>
    </ImageBackground>
  );
};

const styles = StyleSheet.create({
  background: {
    flex: 1,
  },

  overlay: {
    ...StyleSheet.absoluteFillObject,
    backgroundColor: "rgba(0,0,0,0.7)",
  },
  container: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
    margin: 20,
    textAlign: "center",
  },
  button: {
    margin: 10,
    padding: 10,
    width: "60%",
    height: 100,
    backgroundColor: "darkslateblue",
  },

  btnText: {
    top: 0,
    bottom: 0,
    left: 0,
    right: 0,
    fontFamily: "Montserrat",
    color: "white",
    fontSize: 30,
    textAlignVertical: "center",
  },
});
export default WelcomeScreen;
